namespace MobileApp.Host.Vehicles;

[ApiController]
public class GetVehicle : ControllerBase
{
    private readonly IMediator _mediator;

    public GetVehicle(IMediator mediator)
    {
        _mediator = mediator;
    }

    [Authorize]
    [SwaggerOperation(Tags = new[] { "Vehicles" }, Summary = "Get vehicle")]
    [HttpGet("/api/vehicles/{id}")]
    public async Task<Result<GetVehicleDto>> GetVehicleAsync(Guid id)
    {
        return await _mediator.Send(new GetVehicleQuery(id));
    }

    public class GetVehicleQuery : IRequest<Result<GetVehicleDto>>
    {
        public Guid Id { get; set; }

        public GetVehicleQuery(Guid id)
        {
            Id = id;
        }
    }

    public class GetVehicleDto
    {
        public User Creator { get; set; }
        public List<User> UsersAssigned { get; set; }
        public List<User> UsersAdded { get; set; }
        public string Name { get; set; }
        public string VehicleType { get; set; }
        public string Category { get; set; }
        public DateTime VehicleDateTime { get; set; }
        public int Duration { get; set; }
        public string Country { get; set; }
        public string State { get; set; }
        public string City { get; set; }
        public string PostalCode { get; set; }
        public string Street { get; set; }
        public string StreeNumber { get; set; }
        public string ApartmentNumber { get; set; }
        public string ShortDescription { get; set; }
        public string Description { get; set; }
        public string? Picture { get; set; }
        public int UsersLimit { get; set; }
        public int? AgeFrom { get; set; }
        public int? AgeTo { get; set; }
        public List<SexType>? SexTypes { get; set; }
    }

    public class GetVehicleDtoQueryHandler : IRequestHandler<GetVehicleQuery, Result<GetVehicleDto>>
